import React from "react";
import MemoizedTitle from "./Title";
import MemoizedSubtitle from "./Subtitle";

type NieuwAfspraakProps = {
    title: string
}

const NieuwAfspraak: React.FC<NieuwAfspraakProps> = (props) => {
    return (
        <button>{props.title}</button>
    )
}

export const Afspraken: React.FC = () => {
  return (
    <>
      <MemoizedTitle title={"Afspraken"} />
      <MemoizedSubtitle
        subtitle={"Een planningsaplicatie waar je jouw afspraken tracken kan"}
      />
    </>
  );
};
